}

export function GetWeahterData(): Promise<WeatherData | null> {
  let result: WeatherData | null = null;
  return fetch(
    "https://api.open-meteo.com/v1/forecast?latitude=54.69&longitude=25.28&hourly=temperature_2m"
  ).then((response) => {
    if (!response.ok) {
      return null;
